import React from "react";
import CardBtn from "../CardBtn";
import "./style.css";

function Card(props) {
  return (
    <div className="card">
      <CardBtn
        onClick={props.handleBtnClick}
        data-value="Location"
      />
      <CardBtn
        onClick={props.handleBtnClick}
        data-value="Birthday"
      />
    </div>
  );
}

export default Card;
